  <script>
  $(document).ready(function(){
    var edges = {};
    $('path').each(function(){
      path = $(this);
      ids = path.attr("class").split(/\s+/g);
      // console.log(ids);
    });

    var cow = $(".info");

    var rrcc = $('.RRCC');
    rrcc.attr('r', '30.0');
    rrcc.attr('fill', 'white');

    $('circle').hover(
      function(){

        var me = $(this);
        id = me.attr("class");
        me.attr("stroke-width", '1.0');
        me.attr("r", me.attr("r") * 2);
        cow.text(id);
      },
      function(){
        var me = $(this);
        me.attr("r", me.attr("r") / 2);
        me.attr("stroke-width", '2.0');
      }
      );
  });
  </script>
